import { useMemo } from "react";
import {
  Chart as ChartJS,

  Title,
  Tooltip,
  Legend,
  Filler,
} from "chart.js";
import { Line } from "react-chartjs-2";

ChartJS.register(

  Title,
  Tooltip,
  Legend,
  Filler
);

const supply = [226,345, 125, 142, 543, 324, 546, 124, 245,432,321,553];
const electricity = [163,115, 213, 325, 423,154, 649, 734, 615,454,221,311];
const labels = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul","Aug","Sep","Oct","Nov","Dec"];

const options = {
  fill: true,
  responsive: true,
  scales: {
    y: {
      min: 0,
    },
  },
  plugins: {
    legend: {
      display: true,
    },
  },
};

export default function LineChart() {
  const data = useMemo(function () {
    return {
      datasets: [
        {
          label: "Supply",
          data: supply,
          borderColor: "rgb(75, 192, 192)",
          backgroundColor: "rgb(755, 152, 152)",
        },

        {
          label: "Eleciricity",
          data: electricity,

          borderColor:"rgb(755, 152, 152)",
          backgroundColor:"rgba(745, 142, 132, 0.6)",

        },
      ],
      labels,
    };
  }, []);

  return <Line data={data} options={options} />;
}
